 "<p>Where you have a number of images that relate \nto each other or to a particular learning exercise you may wish to display \nthese in a gallery context rather then individually.<\/p>": "<p>Je\u015bli masz kilka obraz\u00f3w, kt\u00f3re s\u0105 powi\u0105zane \nz okreslonym \u0107wiczeniem, mo\u017cesz chcie\u0107 je wy\u015bwietli\u0107  \nw za pomoc\u0105 galerii zamiast pojedy\u0144czych zdj\u0119\u0107.<\/p>", 
