 "Create educational resources with different contents: texts, multimedia materials, interactive activities, internet links...": "Tworzy\u0107 materia\u0142y edukacyjne o r\u00f3\u017cnej tre\u015bci: teksty, materia\u0142y multimedialne, dzia\u0142ania interaktywne, linki internetowe...", 
