 "eXeLearning, the EXtremely Easy to use eLearning authoring tool\n   Usage: %s [OPTION] [PACKAGE]\n  -V, --version    print version information and exit\n  -h, --help       display this help and exit\n  --standalone     Run totally from current directory\n  --portable       Run in portable mode\nSettings are read from exe.conf in $HOME\/.exe on Linux\/Unix\/Mac OS or\nin Documents and Settings\/<user name>\/Application Data\/exe on Windows XP or\nUsers\/<user name>\/AppData\/Roaming\/exe on Windows 7": "eXeLearning, wyj\u0105tkowo \u0142atwe w u\u017cyciu narz\u0119dzie do tworzenia e-learningu\n   Wykorzystanie: %s [OPCJA] [PAKIET]\n  -V, --wersja    wydrukuj informacje o wersji i zako\u0144cz\n  -h, --pomoc       wy\u015bwietl pomoc i zako\u0144cz\n  --samodzielny     Uruchom kompletny z bie\u017c\u0105cego katalogu\n  --przeno\u015bny       Uruchom w trybie przeno\u015bnym\nUstawienia s\u0105 odczytywane z exe.conf w $HOME\/.exe na Linux\/Unix\/Mac OS lub\nw Dokumentach i Ustawieniach\/<user name>\/Dane aplikacji\/exe w systemie Windows XP lub\nU\u017cytkownicy\/<user name>\/AppData\/Roaming\/exe w systemie Windows 7", 
 "Although more often used in formal testing \nsituations MCQs can be used as a testing tool to stimulate thought and  \ndiscussion on topics students may feel a little reticent in responding to. \n\nWhen designing a MCQ test consider the following:\n<ul>\n<li> What learning outcomes are the questions testing<\/li>\n<li>    What intellectual skills are being tested<\/li>\n<li> What are the language skills of the audience<\/li>\n<li> Gender and cultural issues<\/li>\n<li> Avoid grammar language and question structures that might provide \n     clues<\/li>\n<\/ul>\n ": "Cz\u0119\u015bciej u\u017cywan\u0105 form\u0105 testu w wiekszo\u015bci \nprzypadk\u00f3w jest MCQs. Mo\u017ce on by\u0107 u\u017cyty do wywo\u0142ania przemysle\u0144 i dyskusji nad  \ntematem trudnym dla uczni\u00f3w. \n\nProjektuj\u0105ce  MCQ test pami\u0119taj o:\n<ul>\n<li> Jakie zdolno\u015bci itelektualne b\u0119d\u0105 sprawdzane<\/li>\n<li> Jakie jest wiedza j\u0119zykowa odbiorcy kursu <\/li>\n<li> Narodowo\u015bci i r\u00f3w\u017cnice kulturowe<\/li>\n<li> Unikaj rozbudowanych pyta\u0144, kt\u00f3re mog\u0105 zawiera\u0107 wskaz\u00f3wki<\/li>\n<\/ul>\n ", 
