 "FPD - Situation": "FPD - Sytuacja", 
 "First activity. Creation of the learning diary in the suggested format.": "Pierwsza aktywno\u015b\u0107. Stworzenie dziennika edukacyjnego w sugerowanym formacie.", 
 "Loaded Plugins": "Za\u0142adowane wtyczki", 
 "Bosnian ": "Bo\u015bniacki", 
 "Table Properties": "W\u0142a\u015bciwo\u015bci tabeli", 
 "<p>\nThe image with text iDevice can be used in a number of ways to support both\nthe emotional (affective) and learning task (cognitive) dimensions of eXe\ncontent. \n<\/p><p>\n<b>Integrating visuals with verbal summaries<\/b>\n<\/p><p>\nCognitive psychologists indicate that presenting learners with a\nrepresentative image and corresponding verbal summary (that is presented\nsimultaneously) can reduce cognitive load and enhance learning retention.\nThis iDevice can be used to present an image (photograph, diagram or\ngraphic) with a brief verbal summary covering the main points relating to\nthe image. For example, if you were teaching the functions of a four-stroke\ncombustion engine, you could have a visual for each of the four positions of\nthe piston with a brief textual summary of the key aspects of each visual.\n<\/p>": "<p>\nObraz z tekstem iObiektu mo\u017ce by\u0107 u\u017cyty na wiele sposob\u00f3w do wspomagania \nzada\u0144 emocjonalnych i edukacyjnych eXe. \n<\/p><p>\n<b> Integrancja wizualnych i s\u0142ownych podsumowa\u0144<\/b>\n<\/p><p>\nBadania pokazuj\u0105 i\u017c prezentowanie uczniom jednocze\u015bnie \nodpowiednich obraz\u00f3w odnosz\u0105cych si\u0119 do streszczenia tekstu \npomaga zredukowa\u0107 przeci\u0105\u017cenie informacjami i wspomaga zdolno\u015b\u0107 zapami\u0119tywania. \nTen obiekt mo\u017ce by\u0107 u\u017cyty do prezentacji obrazu (fotografia, diagram lub \nobrazek) wraz z opisem podsumowuj\u0105cym dotycz\u0105cym g\u0142\u00f3wnych informacji odnosz\u0105cych si\u0119 \ndo obrazu. Np. je\u015bli uczysz o czterosuwowym silniku spalinowym \nmo\u017cesz u\u017cy\u0107 grafiki lub zdj\u0119cia dla ka\u017cdego z czterech po\u0142o\u017ce\u0144 \nt\u0142oka z podsumowuj\u0105cym tekstem o kluczowych aspektach ka\u017cdego z obraz\u00f3w.\n<\/p>", 
 "Medium gray": "\u015aredni szary", 
 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Ten typ testu to \u0107wiczenie w kt\u00f3rym z tekstu usuni\u0119to pewne wyrazy lub frazy. Ucze\u0144 musi wype\u0142ni\u0107 puste miejsca. Zazwyczaj uzywany jest do nast\u0119puj\u0105cych cel\u00f3w:<\/p><ol><li>Do sprawdzenia wiedzy o podstawowych zagadnieniach lekcji (w formie sprawdzania przed w trakcie i na zako\u0144czenie lekcji).<\/li><li>Do sprawdzenia zdolno\u015bci czytania ze zrozumieniem.<\/li><li>Do sprawdzenia zasobu s\u0142ownictwa (dla os\u00f3b ucz\u0105cych si\u0119 angielskiego).<\/li><li>Do sprawdzenia umiejetno\u015bci tworzenia zda\u0144 i\/lub gramatyki.<\/li>", 
