 "Greek Wikipedia Article": "Artyku\u0142 z greckiej Wikipedii", 
 "<p>If left unchecked a small number of spelling and capitalization errors will be accepted. If checked only an exact match in spelling and capitalization will be accepted.<\/p><p><strong>For example:<\/strong> If the correct answer is <code>Elephant<\/code> then both <code>elephant<\/code> and <code>Eliphant<\/code> will be judged <em>\"close enough\"<\/em> by the algorithm as it only has one letter wrong, even if \"Check Capitilization\" is on.<\/p><p>If capitalization checking is off in the above example, the lowercase <code>e<\/code> will not be considered a mistake and <code>eliphant<\/code> will also be accepted.<\/p><p>If both \"Strict Marking\" and \"Check Capitalization\" are set, the only correct answer is \"Elephant\". If only \"Strict Marking\" is checked and \"Check Capitalization\" is not, \"elephant\" will also be accepted.<\/p>": "<p>Je\u015bli pozostawisz t\u0105 opcje niezaznaczon\u0105, algorytm zaakceptuje ma\u0142\u0105 liczb\u0119 b\u0142\u0119d\u00f3w. Jesli zaznaczysz t\u0119 opcje tylko dok\u0142adnie identyczne odpowiedzi (pisownia, wielko\u015b\u0107 liter) b\u0119d\u0105 zaakceptowane.<\/p><P><strong> Np. <\/strong> je\u015bli  prawid\u0142ow\u0105 odpowiedzi\u0105 jest <code>S\u0142o\u0144<\/code> to obie odpowiedzi <code>s\u0142o\u0144<\/code> i <code>Slon<\/code> zostan\u0105 ocenione jako<em>\"wystarczaj\u0105co blisko\"<\/em> przez algorytm je\u015bli tylko jedna litera jest z\u0142a, nawet je\u015bli opcja  \"Sprawd\u017a wielko\u015b\u0107 liter\"  jest w\u0142\u0105czona.<\/p><p>Je\u015bli opcja ta jest wy\u0142aczona w tym przyk\u0142adzie ,rozpocz\u0119cie z ma\u0142ej litery<code>s<\/code> nie zostanie potraktowane jako b\u0142\u0105d i <code>slon<\/code> zostanie uznany za poprawn\u0105 odpowied\u017a.<\/p><p>Je\u015bli oba pola \"Restrykcyjne sprawdzanie\" i \"Sprawdzanie wielko\u015bci liter\" s\u0105 ustawione, jedyn\u0105 poprawn\u0105 odpowiedzi\u0105 jest \"Slo\u0144\". Je\u015bli tylko zaznaczono \"Restrykcyjne sprawdzanie\" a niezaznaczono \"Sprawd\u017a wielko\u015b\u0107 liter\" s\u0142owo, \"slon\" tak\u017ce zostanie zaakceptowane.<\/p> ", 
